    public boolean find132pattern(int[] nums) {
        boolean result = false;
        for (int count = 0; count <= nums.length - 3; count++) {
            int i = count;
            for (int j = count + 1; j < nums.length - 1; j++) {
                if(!(nums[i]<nums[j])){
                    break;
                }
                for (int k = count + 2; k < nums.length; k++) {
                    System.out.println((nums[i] + " < " + nums[k] + " && " + nums[k] + " < " + nums[j]) + " : " + (nums[i] < nums[k] && nums[k] < nums[j]));
                    if (nums[i] < nums[k] && nums[k] < nums[j]) {
                        result |= true;
                        break;
                    }
                }
            }
             if(result){ break;}

        }
        return result;
    }
